INSERT INTO "public"."imprevisti" ("id", "titolo", "descrizione", "user_id", "ultEstrazione", "qtGiocatori", "titolariRosa") VALUES
	('628b2f97-52c6-40c8-b433-79b3303fcfec', 'CALCIO CAMMINATO', 'Mister Finazzi esige ordine e calma in campo. Schiera titolare in ogni ruolo per questa partita il giocatore con la statistica di velocità più bassa.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 11),
	('7e4826b0-de17-417e-a992-ae4105726428', 'COSTE TO COSTE 2.0', 'È andato via Coste? Nessun problema. Prendi palla col difensore che lo sostituisce e portala Coste to Coste, obiettivo gol/assist. Se riesci prossima partita le nostre slide velocità avranno un +5, altrimenti - 5', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 11),
	('e3de199c-5e56-4aef-afa0-fe1e06276610', 'CHI HA FATTO PALO?', 'Un grande imprenditore Arabo, Nalir Colbuk, si è appassionato alle ultime vicende della Juve Stabia. Non potendo fare a meno di ridere di gusto ad ogni legno colpito dalla squadra, decide di investire su di essa: ad ogni palo colpito durante l''episodio, aggiungi un punto al saldo mercato. ', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 30),
	('575a00f9-4955-43a6-8932-42959cba8b83', 'BRACCIA TOLTE A...', 'Il presidente della Juve Stabia decide di assumere nella sua ditta edilizia, la Abusivismo S.p.a,  i 5 giocatori più scarsi della primavera. Acquisisci 0,5 punti per ogni giocatore mandato in cantiere.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 30),
	('b37331d5-9272-40ed-bcb2-5b444e50fa4c', 'PAPERINO', 'Dalle visite mediche si scopre Kwakman sia il frutto di una tresca in Olanda di Pato, il “Papero” per eccellenza della serie A, finto infortunio e vacanza per un mese a Rio con il padre.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 30),
	('556a0776-8275-430e-b54d-bc31c88ef0ed', 'PINTO FOOTBALL LIFE', 'Il prode Pinto dopo aver visto cosa accade nei bagni di Football Life invita 3 dei suoi compagni di squadra per una notte folle lui ed i 3 sorteggiati salteranno le prossime 2 partite in casa.', '50f68995-4765-48a4-8a96-49436c77b0c2', true, 3, 30),
	('8e9595c7-a83f-4941-b758-c0edaf444c7a', 'AUDIO IN QUESTURA', 'Mister Finazzi è stato squalificato dopo il recupero dell''audio compromettente registrato dopo il secondo gol dell''Atalanta, simula la prossima partita senza possibilità di intervenire.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 11),
	('c6dd148e-3d9c-498a-ab5e-8955ffbcfe08', 'COME MOTTA', 'Fai debuttare 3 giovani dal vivaio, 1 per reparto e schierarli fuori ruolo. Se vinci guadagni 3 punti per il mercato, se perdi la partita perdi 3 punti. Se invece pareggi devi rifare l''imprevisto.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 30),
	('6be5214b-771f-49ac-b8f3-fbe259e2d104', 'GIORGIONE', 'Il noto cuoco, si emoziona per le gesta della Juve Stabia e decide di offrire un pasto alla squadra. I giocatori finiscono per avere le vene imburrate, alterando le loro prestazioni. (aumenta di 10 velocità, accelerazione e velocità tiro ma anche errore passagi, errore tiri e errore primo controllo)', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 30),
	('8d8fcdb3-ac7d-48e6-aacc-ea0e3211deff', 'CASSANATA', 'Il giocatore estratto combina una "cassanata" nei confronti dello staff e di mister Finazzi. Fuori tutto l''episodio.', '50f68995-4765-48a4-8a96-49436c77b0c2', true, 1, 30),
	('ad977ba2-1b10-4f5f-a836-ccace96b3481', 'DFGDFG', 'ewrwer', '82f98a95-3560-4ef2-9e54-864b0f2e02d6', true, 1, 30),
	('bfffa169-fecf-47a3-88b8-044d91f73b2c', 'NOSTALGIA CANAGLIA', 'Lim, dopo aver trascorso le vacanze estive nel Brunei, tornato a Castellammare lamenta una profondissima nostalgia del suo paese, specialmente per la mancanza di un suo caro amico: Tam. Acquistalo e schieralo titolare in coppia con Lim per tre partite. Ad ogni assist/gol eseguiti da uno dei due, aggiungi un punto mercato, in segno del loro meraviglioso legame.', '50f68995-4765-48a4-8a96-49436c77b0c2', false, 0, 11),
	('e4f564a8-8e0d-4428-8121-e8bfd5921b24', 'VOLARE', 'La dirigenza, stanca delle prestazioni di Pinto, decide di farlo "Volare" come la nota canzone di Modugno. Metti Pinto sul mercato in uscita nella prima sessione di mercato disponibile.
