INSERT INTO "public"."salvaxdopo" ("id", "titolo", "descrizione", "user_id") VALUES
	('3fbcc1c2-36d1-4aea-89ca-3104255816f9', 'MOSTRO DAL PASSATO', 'Hai un sogno rivelatore. Riacquista Koren entro l''ultima stagione della serie e schieralo capitano titolare in una finale di una competizione. Sarà un sogno o un incubo?', '50f68995-4765-48a4-8a96-49436c77b0c2'),
	('9bc995b4-8705-4d6a-9fd6-65c6eae1ebaa', 'MERCATO DELLE IDEE', 'Il Direttore sportivo in un momento di illuminazione, decide di acquistare un giocatore con la sola forza delle parole e del coinvolgimento nel progetto Juve Stabia: acquista un centrocampista dagli svincolati di qualsiasi overall e fallo giocare 2 partite di fila senza mai toglierlo. I punti per il suo acquisto saranno ridotti della metà arrotondati per difetto grazie alle idee proposte.', '50f68995-4765-48a4-8a96-49436c77b0c2'),
	('d38c7d67-c86d-4716-96ba-02ee84a47db1', 'A VOLTE RITORNANO', 'Viene nominato il nuovo ds, Igli, che torna in grande spolvero. Compra un giocatore proveniente dai balcani, di massimo 24 anni e senza spendere alcun tipo di punto, e schieralo titolare in almeno 10 partite durante tutta la stagione.', '50f68995-4765-48a4-8a96-49436c77b0c2'),
	('0bec9fd4-1484-4439-b145-2e7ea7bfeed4', 'FONDATORE DI STABIA', 'Il calciatore ha cominciato a studiare storia americana per conseguire la laurea ed ha trovato affascinante il ruolo di diversi presidenti degli Stati Uniti, forte anche del suo pesante cognome che lo rende fiero.
